  <div class="card">
    <div class="card-body">
      <h5 class="card-title">Bank Name</h5>
      <div  className="btn btn-primary">remove</div>
    </div>
  </div>
  )

}

const mapStateToProps = (state) => {
  return {
    accounts: state.linkReducer.accounts,
  }
}

const mapDispacthToProps = (dispatch) => {
  return {
    dispatch
  }
}

export default connect(mapStateToProps, mapDispacthToProps)(UserAccounts)
